import React from "react";
import "./portfolio.css";
import profilePic from "../../resources/pic/joey.JPG";

const Portfolio = () => {
  return (
    <div className="portfolio">
      <div className="picuture">
        <img src={profilePic} alt="picture" />
      </div>
    </div>
  );
};

export default Portfolio;
